    true,nt"url": null,nt"notes": "The Elemental Data Index provides access
    to the holdings of NIST Physical Measurement Laboratory (PML) online data organized
    by element. It is intended to simplify the process of retrieving online scientific
    data for a specific element from various online databases, including atomic spectroscopy,
    atomic data, x-ray absorption, and nuclear data. For some of the databases, the
    data are immediately retrieved; for others, the retrieval form is provided with
    the element entered in the form, but additional options must be selected in order
    to retrieve the data. Each of the databases can be individually accessed from the
    PML's Physical Reference Data page (http://pml.nist.gov/data).",nt"license_title":
